import './App.css';
import {BrowserRouter as Switch,Router,Route} from 'react-router-dom';
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Home from './Pages/Home';
function App() {
  return (

  <main>

    <Navbar/>
    <Router>
   <Switch>
    <Route path="/" exact component={Home}>

    </Route>
   </Switch>
   </Router>
   <Footer/>

  </main>

  );
}

export default App;
